import React from "react";
import './MyName.css'

function MyName() {
    return (
        <div className="MyName">
            <p className="MyName-test">Welcome!</p>
                <h1 className="MyName-test">Personal Info</h1>
                <p className="MyName-test">FirstName:</p>
                <input type="text" className="MyName-test" name="firstName" defaultValue="阳"/>
                <p className="MyName-test">Last Name:</p>
                <input type="text" className="MyName-test" name="lastName" defaultValue="易"/><br/>
                <input type="submit" className="MyName-test" name="123"/>
        </div>
    );
}

export default MyName
